import Lo from './Login.module.css';
import { Link } from "react-router-dom";

export default function Login() {
  return (
    <div>
      <div className={Lo.mncont}>
        <lable className={Lo.lab}>Mobile Number : </lable>
        <input type='number' className={Lo.input1} placeholder='Enter Your Mobile Number'></input>
        <lable className={Lo.lab}>Name : </lable>
        <input type='text' className={Lo.input1} placeholder='Enter Your Name'></input>
        <Link to="/Main" className={Lo.lk} type='submit'>Signup</Link>
      </div>
    </div>
  )
}
